INSERT INTO Posts (Title, Price, Description, Email, Agreement, SubCategory_ID, Location_ID) VALUES ('Childcare Educator ', 300, 'If you are looking for a job you love going to each day, where laughter is an everyday happening please apply. If you think working with children is rewarding and fun we are looking for you. Our center provides opportunities to acquire associates degrees in Early Childhood Education with no cost to you. If you want to learn and grow as a professional while obtaining your education and working within the field email us a resume. We look forward to meeting you soon. ', 'kenny@gmail.com', 1, '7', '7');
INSERT INTO Posts (Title, Price, Description, Email, Agreement, SubCategory_ID, Location_ID) VALUES ('Human Resources Manager ', 100, 'We are looking for a self-starter with great communication skills and comfortable dealing with all types of personalities. This person must have an excellent grasp of human resource concepts and practices, the ability to get along well with all types of people, and to listen intently and communicate clearly regarding a wide variety of employee related problems and issues. If you honestly possess these qualities, you may be the person we are looking for.', 'kenny@gmail.com', 1, '8', '8');
